from datetime import datetime, timedelta
import http.client
import json

departure_date_hour = '23/06/2024T10:30:00'
datetime_date = datetime.strptime(departure_date_hour, "%d/%m/%YT%H:%M:%S")

def transform_routes(response):
    print('montando rotas')
    routes = []
    for route in response:
        leg = {
            "distanceMeters": route["legs"][0]["distanceMeters"],
            "staticDuration": int(route["legs"][0]["staticDuration"].split("s")[0]),
            # "polyline": route["legs"][0]["polyline"]["encodedPolyline"],
            "endLocation": route["legs"][0]["endLocation"],
            "startLocation": route["legs"][0]["endLocation"],
            "steps": []
        }

        for step in route["legs"][0]["steps"]:
            legStep = {
                "staticDuration": int(step["staticDuration"].split("s")[0]),
                # "polyline": step["polyline"]["encodedPolyline"],
                "endLocation": {
                    "latitude": step["endLocation"]['latLng']["latitude"],
                    "longitude": step["endLocation"]['latLng']["longitude"]
                }
            }

            leg["steps"].append(legStep)

        routes.append({
            "leg": leg,
            "distanceMeters": route["distanceMeters"],
            "staticDuration": int(route["staticDuration"].split("s")[0]),
            "description": route["description"],
            # "routeToken": route["routeToken"],
            # "polyline": route["polyline"]["encodedPolyline"],
        })

    # for index, route in enumerate(routes):

    return routes

def measure_points(leg):
    print('definindo pontos de medição')
    """
    Calcula pontos de medição a cada 1800 segundos em uma etapa de rota.

    Args:
        leg: Um dicionário representando uma etapa de rota, com uma lista de passos ("steps").

    Returns:
        Uma lista de dicionários, cada um contendo a localização e o tempo de um ponto de medição.
    """
    measure_points = [{
         "location": {
                    "latitude": leg["startLocation"]["latLng"]["latitude"],
                    "longitude": leg["startLocation"]["latLng"]["longitude"],
                },
        "timer": 0
    }]
    time_counter = 0
    last_timer = 0

    for step in leg["steps"]:
        time_counter += step["staticDuration"]

        while time_counter >= 1800:
            last_timer += 1800
            measure_points.append({
                "location": {
                    # "latitude": float("{:.3f}".format(step["endLocation"]["latitude"])),
                    # "longitude": float("{:.3f}".format(step["endLocation"]["longitude"])),
                    "latitude":step["endLocation"]["latitude"],
                    "longitude":step["endLocation"]["longitude"],
                },
                "timer": last_timer
            })
            time_counter -= 1800

    return measure_points

def mount_climatologic_data(routes, weather):
    climatologic_analisys_routes = []
    
    for route in routes:
        print('MONTANDO DADOS DA ROTA')

        climatologic_analisys_points = []

        for point in route["mensurement_points"]:
            delta = timedelta(seconds=point["timer"])
            point_hour = datetime_date + delta
            point_hour_str = point_hour.strftime("%d/%m/%YT%H:%M:%S")

            latLngKey = "{},{}".format(
                float("{:.3f}".format(point['location']['latitude'])),
                float("{:.3f}".format(point['location']['longitude'])),
            )
            _, time_str = point_hour_str.split("T")  
            point_only_hour, point_minute = map(int, time_str.split(":")[:2]) 

            point_only_hour = str(point_only_hour + 1 if point_minute > 30 else point_only_hour)
           
            weather_by_latLng = find_climatologic_latLng(weather, latLngKey)
            match_climatologic = find_climatologic_match(weather_by_latLng[latLngKey], point_only_hour)

            climatologic_analisys_points.append({
                "location": {
                    "latitude": point["location"]["latitude"],
                    "longitude": point["location"]["longitude"],
                },
                "hour": point_hour.strftime("%d/%m/%YT%H:%M:%S"),
                "climatologic_data": match_climatologic 
            })

        climatologic_analisys_routes.append({
            "description": route["description"],
            "climatologic_analisys": climatologic_analisys_points,
            # "routeToken": route["routeToken"],
            # "polyline": route["polyline"]
        })
        
    return climatologic_analisys_routes

def find_climatologic_latLng(weather, latLngKey):
    for obj in weather:
        if latLngKey in obj:
            return obj
    return None

def find_climatologic_match(weather, hour):
    for obj in weather:
        if obj["datetime"].startswith(hour):
            return obj
    return None

def mensure_routes(mensurement_point):
    weather_results = []

    for point in mensurement_point:
        print('buscando par: {}'.format(point))
        weather_results.append(call_weather_api(point["latitude"], point["longitude"]))

    return weather_results

def call_weather_api(latitude, longitude):
    print('iniciando chamada à API de previsão climática')

    API_KEY = "MHPYKWVM8BCBW8QBWAZNH6H2Y"
    dateToSearch = datetime.strptime(departure_date_hour, "%d/%m/%YT%H:%M:%S").strftime("%Y-%m-%d").split("T")[0]

    endpoint_path = "/VisualCrossingWebServices/rest/services/timeline/{}%2C%20{}/{}?unitGroup=metric&key={}&contentType=json".format(latitude, longitude, dateToSearch, API_KEY)
    host = "weather.visualcrossing.com"
    headers = {
      "Content-Type": "application/json",
    }

    conn = http.client.HTTPSConnection(host)
    conn.request("GET", endpoint_path, headers=headers)

    weather_result = conn.getresponse()
    decoded_weather_result = json.loads(weather_result.read().decode())

    weather_per_hour = []

    for hour in decoded_weather_result["days"][0]["hours"]:
        weather_per_hour.append(hour)

    return {"{},{}".format(latitude, longitude): weather_per_hour}
 
def mount_points_to_search(mensurement_routes):
    points_to_search = [] 

    for route in mensurement_routes:
        for point in route["mensurement_points"]:
            print('--->',point)
            print(type(point['location']['latitude']))
            coordenada = {
                "latitude": float("{:.3f}".format(point['location']['latitude'])),
                "longitude": float("{:.3f}".format(point['location']['longitude'])), 
            }
            if coordenada not in points_to_search:
                points_to_search.append(coordenada)
    
    return points_to_search

def mount_points_to_mensure(routes):
    transformed_routes = transform_routes(routes)
    mensurement_routes = []

    for route in transformed_routes:
        mensurement_points = measure_points(route["leg"])        
        mensurement_routes.append({
            "distanceMeters": route["distanceMeters"],
            "staticDuration": route["staticDuration"],
            "description": route["description"],
            "mensurement_points": mensurement_points
            # "routeToken": route["routeToken"],
            # "polyline": route["polyline"],
        })

    return mensurement_routes

